INSERT INTO `tl_calendar_events` (`id`, `pid`, `tstamp`, `title`, `featured`, `alias`, `author`, `addTime`, `startTime`, `endTime`, `startDate`, `endDate`, `pageTitle`, `robots`, `description`, `location`, `address`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `recurring`, `repeatEach`, `repeatEnd`, `recurrences`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(1, 1, 1569916941, 'Vortrag zum Thema \"Bienen schützen\"', 0, 'vortrag-zum-thema-bienen-schuetzen', 1, 1, 1569596400, 1569607200, 1569535200, NULL, '', '', NULL, 'Musterstadt', 'Bienenallee 17', '<p>Es gibt viele Faktoren, die für das Bienensterben verantwortlich sind. Zum einen finden Bienen nicht mehr genug Nahrung, da in der Landschaft immer mehr Monokulturen angebaut werden, die nur für eine kurze Zeit blühen.</p>', 1, 0, 0xe0645581e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 1, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 4294967295, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
INSERT INTO `tl_calendar_events` (`id`, `pid`, `tstamp`, `title`, `featured`, `alias`, `author`, `addTime`, `startTime`, `endTime`, `startDate`, `endDate`, `pageTitle`, `robots`, `description`, `location`, `address`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `recurring`, `repeatEach`, `repeatEnd`, `recurrences`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(2, 1, 1569916929, 'Vortrag zum Thema \"Honig- und Wildbienen\"', 0, 'vortrag-zum-thema-honig-und-wildbienen', 1, 1, 1573387200, 1573392600, 1573340400, NULL, '', '', NULL, 'Musterstadt', 'Bienenallee 17', '<p>Es gibt auf der Welt ca. neun Honigbienenarten und mehr als 30.000 unterschiedliche Wildbienenarten.</p>', 1, 0, 0xdf8a8842e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 1, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 4294967295, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
INSERT INTO `tl_calendar_events` (`id`, `pid`, `tstamp`, `title`, `featured`, `alias`, `author`, `addTime`, `startTime`, `endTime`, `startDate`, `endDate`, `pageTitle`, `robots`, `description`, `location`, `address`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `recurring`, `repeatEach`, `repeatEnd`, `recurrences`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(3, 1, 1569916918, 'Vortrag zum Thema \"Urban Beekeeping\"', 0, 'vortrag-zum-thema-urban-beekeeping', 1, 1, 1580047200, 1580056200, 1579993200, NULL, '', '', NULL, 'Musterstadt', 'Bienenallee 17', '<p>Urban Beekeeping, das Imkern in Großstädten, ist ein neuer Trend und ebenfalls eine gute Sache um Bienen zu schützen.</p>', 1, 0, 0xdd4e81f9e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, 'a:2:{s:4:\"unit\";s:5:\"years\";s:5:\"value\";s:1:\"1\";}', 0, 0, 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
