0698189, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:11:\"Honigbienen\";}', '<p>Auf der ganzen Welt gibt es <strong>neun Honigbienenarten</strong>, wovon nur die westliche Honigbiene in Europa heimisch ist.</p>\n<p>Die Honigbiene kann täglich etwa <strong>300 Blüten</strong> bestäuben und übernimmt zusammen mit den Wildbienen und anderen bestäubenden Insekten ca. <strong>80 bis 90 Prozent</strong> der Bestäubungsarbeit.</p>', 1, 0, 0, 0xb4150bb8e9a911e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', '', 1, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:21:\"white-text dark-image\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', 0x613a323a7b693a303b733a313a2233223b693a313b733a313a2232223b7d, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '{{link_url::2}}#honigbienen', 'Mehr erfahren ...', '', '', NULL, 0xdc7e12f3e41e11e98cc3e0d55edd9ad9, NULL, NULL, NULL, '');
