2149, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:50:\"Bis zu 50.000 Honig&shy;bienen leben in einem Volk\";}', '<p>Auf der ganzen Welt gibt es 9 Honigbienenarten, wovon nur die westliche Honigbiene in Europa heimisch ist.</p>\n<p>Honigbienen leben in einem großen Volk, dass bis zu <strong>50.000 Mitglieder</strong> zählen kann und können nicht alleine überleben, da sie den sozialen Kontakt zu anderen Bienen benötigen. Das Volk besteht aus einer <strong>Königin</strong>, den <strong>Arbeitsbienen</strong> und <strong>Drohnen</strong>. Während die Arbeiterinnen für das Sammeln, Putzen und Wache halten zuständig sind, besteht die Aufgabe der Drohnen nur darin eine Königin zu befruchten und damit das Überleben des Volkes und der Nachkommen zu sichern.</p>', 1, 0, 0, 0x6d5db348ea7711e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:11:\"honigbienen\";i:1;s:16:\"sticky-teaserbox\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', 0x613a313a7b693a303b733a323a223131223b7d, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', '{{link_url::2}}#article-31', 'Mehr erfahren ...', 'Mehr erfahren ...', 'ce_cthemes_teaserbox_fullheight', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
