70697935, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:17:\"Bienen schützen!\";}', '<p>Da Bienen und andere bestäubende Insekten <strong>80 bis 90 Prozent der gesamten Bestäubungsarbeit</strong> übernehmen, wäre es für die Umwelt fatal, wenn es diese nicht mehr geben würde.</p>\n<p>Umso besorgniserregender ist die Tatsache, dass in den letzten Jahren weltweit konsequent immer mehr Bienenpopulationen einfach wegsterben.</p>', 0, 0, 0, 0xe27cfbfde41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:21:\"white-text dark-image\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', 0x613a323a7b693a303b733a313a2233223b693a313b733a313a2232223b7d, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '{{link_url::2}}#article-33', 'Was kann ich tun?', '', '', NULL, 0xe5116e9ee41e11e98cc3e0d55edd9ad9, NULL, NULL, NULL, '');
