045, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h2>Bienenhonig<br><strong>Nahrungsreserve</strong></h2>\n<p>Der Honig, der aus Nektar von Blüten und aus Honigtau besteht, ist die Nahrungsreserve der Bienen und wird nur dann erzeugt, wenn die Ernährung des Volkes und die Aufzucht der Brut gedeckt ist.</p>\n<p>Abhängig von der Art der Pflanzen, die die Bienen sammeln, hat der Honig verschiedene Eigenschaften. So ist Akazienhonig z. B. sehr hell und flüssig und andere Sorten wie der Rapshonig werden dagegen fest.</p>', 1, 0, 0, 0xf8d38a80ea7911e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', '{{link_url::2}}#article-31', 'Mehr erfahren ...', 'Mehr erfahren ...', 'ce_cthemes_teaserbox_nature', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
