'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p>Bienen müssen geschützt werden, denn diese fleißigen Helfer spielen eine zentrale Rolle im Erhalt unserer Kultur- und Landwirtschaft. Da Bienen und andere bestäubende Insekten 80 bis 90 Prozent der Bestäubungsarbeit übernehmen, wäre es für die Umwelt fatal, wenn es diese nicht mehr geben würde.</p>\n<p><strong>Es gibt viele Dinge, die man tun kann, um den Bienen zu helfen:</strong></p>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
