{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p>Bienen müssen geschützt werden, da es ohne diese fleißigen Helfer viele Dinge gar nicht mehr geben würden. Da Bienen und andere bestäubende Insekten 80 bis 90 Prozent der Bestäubungsarbeit übernehmen, wäre es für die Umwelt fatal, wenn es diese nicht mehr geben würde.</p>\n<p><strong>Es gibt viele Dinge, die man tun kann, um den Bienen zu helfen:</strong></p>\n<ul>\n<li>bienenfreundliche Blumen anpflanzen</li>\n<li>den örtlichen Imker unterstützen</li>\n<li>Aufstellen von Nisthilfen</li>\n<li>Urban Beekeeping</li>\n<li>Bienenpatenschaft</li>\n<li>Nutzen von saisonalen Lebensmittel aus regionaler ökologischer Landwirtschaft</li>\n<li>Honiggläser immer ausspülen - zum Schutz vor Bienenkrankheiten</li>\n<li>auf Pestizide verzichten</li>\n</ul>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
