:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p>Der Honig, der aus dem Nektar von Blüten und aus Honigtau besteht, ist die Nahrungsreserve der Bienen und wird nur dann erzeugt, wenn die Ernährung des Volkes und die Aufzucht der Brut gedeckt ist.</p>\n<p>Abhängig von der Art der Pflanzen, die die Bienen sammeln, hat der Honig verschiedene Eigenschaften. So ist Akazienhonig z. B. sehr hell und flüssig und andere Sorten wie der Rapshonig werden dagegen fest.</p>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
