4367, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<p>Urban Beekeeping, das Imkern in Großstädten, ist ein neuer Trend und ebenfalls eine gute Sache um Bienen zu schützen. Alleine in Berlin gibt es z. B. über 500 Großstadtimker.</p>\n<p>Es ist nicht so, dass es in den Städten keinen geeigneten Lebensraum für Bienen gibt. Parkanlegen, Gärten, Alleen oder auch Balkonpflanzen können für genug Vielfalt und geeigneten Lebensraum sorgen. Zudem ist es in der Stadt durchschnittlich 2 bis 3 Grad wärmer als im Umland, was der Biene gute Voraussetzungen zum Leben schafft.</p>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
