'a:2:{s:4:\"unit\";s:2:\"h3\";s:5:\"value\";s:0:\"\";}', '<table style=\"border-collapse: collapse; width: 100%; height: 170px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 16px;\">\n<td style=\"width: 25%; height: 16px;\">&nbsp;</td>\n<td style=\"width: 25%; height: 16px;\"><strong>Honigbiene</strong></td>\n<td style=\"width: 25%; height: 16px;\"><strong>Wildbiene</strong></td>\n<td style=\"width: 25%; height: 16px;\"><strong>Hummel</strong></td>\n</tr>\n<tr style=\"height: 16px;\">\n<td style=\"width: 25%; height: 16px;\"><strong>Versch. Arten auf der Welt</strong></td>\n<td style=\"width: 25%; height: 16px;\">9</td>\n<td style=\"width: 25%; height: 16px;\">Ca. 30.000</td>\n<td style=\"width: 25%; height: 16px;\">etwa 250</td>\n</tr>\n<tr style=\"height: 16px;\">\n<td style=\"width: 25%; height: 16px;\"><strong>Versch. Arten in Europa</strong></td>\n<td style=\"width: 25%; height: 16px;\">Eine</td>\n<td style=\"width: 25%; height: 16px;\">Mehr als 2.500</td>\n<td style=\"width: 25%; height: 16px;\">etwa 70</td>\n</tr>\n<tr style=\"height: 16px;\">\n<td style=\"width: 25%; height: 16px;\"><strong>Lebensweise</strong></td>\n<td style=\"width: 25%; height: 16px;\">Leben in einem großen Volk.</td>\n<td style=\"width: 25%; height: 16px;\">Leben als Einzelgänger.</td>\n<td style=\"width: 25%; height: 16px;\">Leben für kurze Zeit in einem Volk.</td>\n</tr>\n<tr style=\"height: 90px;\">\n<td style=\"height: 90px; width: 100%;\" colspan=\"4\">\n<p style=\"text-align: center;\">Die Honigbiene kann täglich etwa 300 Blüten bestäuben und übernimmt zusammen mit den Wildbienen und anderen bestäubenden Insekten ca. 80 bis 90 Prozent der Bestäubungsarbeit.</p>\n<p style=\"text-align: center;\">Hummeln können im Vergleich zu Honigbienen mehr als dreimal so viel Blüten am Tag bestäuben.</p>\n</td>\n</tr>\n<tr style=\"height: 16px;\">\n<td style=\"width: 25%; height: 16px;\"><strong>Mitglieder</strong></td>\n<td style=\"width: 25%; height: 16px;\">Bis zu 50.000 + eine Königin</td>\n<td style=\"width: 25%; height: 16px;\">Einzelgänger</td>\n<td style=\"width: 25%; height: 16px;\">500 bis 600 + eine Königin</td>\n</tr>\n</tbody>\n</table>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
