'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h2>Wild- und Honigbienen</h2>\n<p>Es gibt auf der Welt ca. neun Honigbienenarten und mehr als 30.000 unterschiedliche Wildbienenarten.</p>\n<p>Während die <strong>Honigbiene</strong> in einem großen Volk mit vielen anderen Bienen in Bienenstöcken lebt, lebt die <strong>Wildbiene</strong> als Einzelgänger und nistet vor allem im Boden oder sucht sich Pflanzenhalme oder nutzt Fraßgänge von Käfern im Holz.</p>\n<p><strong><span class=\"st\">Egal ob Wildbienen, Honigbienen oder Bienen in der Stadt - Bienen faszinieren, doch ohne unsere Hilfe wird es vielerorts schwer.</span></strong></p>', 1, 0, 0, 0xfc10ab82eaa011e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:3:\"350\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', '', 1, '', 'left', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
