'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:27:\"Wo sind all die Bienen hin?\";}', '<p>Es gibt viele Faktoren, die für das Bienensterben verantwortlich sind. Zum einen finden Bienen nicht mehr genug Nahrung, da in der Landschaft immer mehr Monokulturen angebaut werden, die nur für eine kurze Zeit blühen. Pestizide, der Klimawandel und natürliche Feinde, die teilweise aus anderen Regionen eingeschleppt wurden, bedrohen ebenfalls den Bestand der Bienen.</p>\n<p>Würde es keine Bienen mehr geben, hätte das fatale Folgen für die Umwelt, da sie für den größten Teil der Bestäubung der Pflanzen zuständig sind. Es würde nicht nur keinen Honig mehr geben, sondern z.B. auch viel weniger Obst und Gemüse. Zudem tragen Bienen und andere Blütenbestäuber wesentlich zum Erhalt der Artenvielfalt bei, denn sie sorgen für die Verbreitung hunderttausender Pflanzen, auf die wiederum unzählige Tierarten als Nahrungsgrundlage angewiesen sind.</p>\n<p>Man kann den Bienen ganz einfach helfen, indem man bienenfreundliche Blumen anpflanzt und im Garten natürliche Nistplätze gestaltet. Für eine bienenfreundliche Umwelt sorgt zudem der Kauf von Lebensmitteln aus regionaler ökologischer Landwirtschaft oder auch von Honig von örtlichen Imkern, um sie damit zu unterstützten.</p>', 0, 0, 0, 0xe9a71624c8a811e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:3:\"300\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', '', 1, '', 'left', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
