2, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:25:\"Bienenfreundlicher Garten\";}', '<p>Alleine in Europa gibt es mehr als <strong>2.500 unterschiedliche Wildbienenarten</strong>, in Deutschland geht man von über <strong>550 Arten</strong> aus.</p>\n<p>Genau wie die Honigbienen haben auch die Wildbienen eine große Bedeutung für die Bestäubung von Bäumen, Blumen und Nutzpflanzen.</p>', 0, 0, 1, 0xe9a71624c8a811e9bb5ee0d55edd9ad9, '', '', 'a:3:{i:0;s:3:\"300\";i:1;s:3:\"300\";i:2;s:4:\"crop\";}', '', 1, 'Honigbienen', 'left', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, 0x613a343a7b693a303b733a31363a22dc7e12f3e41e11e98cc3e0d55edd9ad9223b693a313b733a31363a22ddeecba2e41e11e98cc3e0d55edd9ad9223b693a323b733a31363a22deb52134e41e11e98cc3e0d55edd9ad9223b693a333b733a31363a22df8a8842e41e11e98cc3e0d55edd9ad9223b7d, 0, 4, 0, 0, 'custom', 0, 'gallery_default', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
