33615, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:44:\"Mehr als 2.500 Wild­bienen­arten in Europa\";}', '<p>Alleine in Europa gibt es mehr als 2.500 unterschiedliche Wildbienenarten, in Deutschland geht man von über <strong>550 Arten</strong> aus. Die Nistplätze der Wildbienen befinden sich vor allem <strong>unter der Erde</strong>, aber auch Totholz, Pflanzenstängel, leere Schneckenhäuser oder von Menschen gebaute Bienenhotels werden von ihnen gern genutzt.</p>\n<p>Genau wie die Honigbienen haben auch die Wildbienen eine <strong>große Bedeutung</strong> für die Bestäubung von Bäumen, Blumen und Nutzpflanzen.</p>', 1, 0, 0, 0xe4b68b93e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:16:\"sticky-teaserbox\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', 0x613a313a7b693a303b733a323a223131223b7d, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', '{{link_url::2}}', 'Mehr erfahren ...', 'Mehr erfahren ...', 'ce_cthemes_teaserbox_fullheight', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
