54, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:27:\"Teaserboxen mit Sticky-Bild\";}', '<p><strong>Variante 1:</strong> mit voller Bildschirmhöhe und feststehendem Bild, wenn man herunterscrollt</p>\n<p><strong>Variante 2:</strong> vollflächiges Bild, leichter Transparenz und nimmt nicht die komplette Bildschirmhöhe ein</p>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
