1570637976, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:21:\"Wild- und Honigbienen\";}', '<p>Es gibt auf der Welt ca. neun Honigbienenarten und mehr als 30.000 unterschiedliche Wildbienenarten.</p>\n<p>Während die <strong>Honigbiene</strong> in einem großen Volk mit vielen anderen Bienen in Bienenstöcken lebt, lebt die <strong>Wildbiene</strong> als Einzelgänger und nistet vor allem im Boden oder sucht sich Pflanzenhalme oder nutzt Fraßgänge von Käfern im Holz.</p>', 1, 0, 0, 0xdc7e12f3e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:21:\"white-text dark-image\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', 0x613a323a7b693a303b733a313a2233223b693a313b733a313a2232223b7d, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '{{link_url::2}}', 'Weiterlesen ...', '', '', 0x563b969aeab011e98cc3e0d55edd9ad9, NULL, NULL, NULL, NULL, '');
