1569917408, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:10:\"WIldbienen\";}', '<p>Alleine in Europa gibt es mehr als <strong>2.500 unterschiedliche Wildbienenarten</strong>, in Deutschland geht man von über <strong>550 Arten</strong> aus.</p>\n<p>Genau wie die Honigbienen haben auch die Wildbienen eine große Bedeutung für die Bestäubung von Bäumen, Blumen und Nutzpflanzen.</p>', 1, 0, 0, 0xe1c216dbe41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:1:\"1\";}', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:21:\"white-text dark-image\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, '', 0x613a323a7b693a303b733a313a2233223b693a313b733a313a2232223b7d, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '{{link_url::2}}', 'Hier geht\'s lang!', '', '', NULL, 0xdeb52134e41e11e98cc3e0d55edd9ad9, NULL, NULL, NULL, '');
