, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h2>Wildbienen sind<br><strong>Einzelgänger</strong></h2>\n<p>Alleine in Europa gibt es mehr als 2.500 unterschiedliche Wildbienenarten, in Deutschland geht man von über 550 Arten aus. Die Nistplätze der Wildbienen befinden sich vor allem unter der Erde, aber auch Totholz, Pflanzenstängel, leere Schneckenhäuser oder von Menschen gebaute Bienenhotels werden genutzt.</p>\n<p>Genau wie die Honigbienen haben auch die Wildbienen eine große Bedeutung für die Bestäubung von Bäumen, Blumen und Nutzpflanzen.</p>\n<p>Während die Honigbiene in einem großen Volk mit vielen anderen Bienen in Bienenstöcken lebt, lebt die Wildbiene als Einzelgänger und nistet vor allem im Boden oder sucht sich Pflanzenhalme oder nutzt Fraßgänge von Käfern im Holz.</p>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, 'column is-6-desktop', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
