, 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:0:\"\";}', '<h2>Hummeln sind<br><strong>besonders gute Bestäuber</strong></h2>\n<p>Hummeln können im Vergleich zu Honigbienen mehr als dreimal so viel Blüten am Tag bestäuben. Genau wie Honigbienen leben Hummeln nicht als Einzelgänger, sondern in einem Volk, das aber nur für kurze Zeit.</p>\n<p>Hummeln gehören zu den “Echten Bienen” und machen sich von März bis Mai auf die Suche nach einem geeigneten Nistplatz: z. B. Totholzhaufen, Steinplatten, Mäuselöcher oder auch Vogelnester oder Hausisolierungen.</p>\n<p>Sie sind besonders gute Bestäuber, da sie durch ihre lange Zunge und das so genannte Vibrationssammeln besonders gut tiefe Blüten bestäuben können.</p>', 0, 0, 0, NULL, '', '', '', '', 0, '', 'above', NULL, '', NULL, NULL, '', 0, 0, 0, 0, 0, 'ascending', '', '', '', '', NULL, '', '', 0, '', '', '', '', 0, NULL, 0, 4, 0, 0, '', 0, '', '', NULL, '', '', NULL, '', NULL, 0, 0, '', 'none', 0, '', '', NULL, NULL, 0, 300, 0, 0, 0, 0, 0, 0, 0, 0, NULL, 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', 0, '', '', 'sourceText', NULL, 0, 'com_default', 0, 0, 0, 0, 0, 'ascending', NULL, 'column is-6-desktop', NULL, NULL, NULL, NULL, '', '', NULL, '', '', '', NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, '', NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, '');
