INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `featured`, `alias`, `author`, `date`, `time`, `pageTitle`, `robots`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(3, 1, 1569916870, 'Wildbienen sind Einzelgänger', 0, 'wildbienen-sind-einzelgaenger', 1, 1568030400, 1568030400, '', '', NULL, 'Wissenswertes', '<p>Alleine in Europa gibt es mehr als 2.500 unterschiedliche Wildbienenarten, in Deutschland geht man von über 550 Arten aus.</p>', 1, 0, 0xdc4f3957e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `featured`, `alias`, `author`, `date`, `time`, `pageTitle`, `robots`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(4, 1, 1569916788, 'Hummeln sind besonders gute Bestäuber', 0, 'hummeln-sind-besonders-gute-bestaeuber', 1, 1568030400, 1568030400, '', '', NULL, 'Wissenswertes', '<p>Hummeln können im Vergleich zu Honigbienen mehr als dreimal so viel Blüten am Tag bestäuben. Genau wie Honigbienen leben Hummeln nicht als Einzelgänger, sondern in einem Volk, das aber nur für kurze Zeit.</p>', 1, 0, 0xddf39ffbe41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `featured`, `alias`, `author`, `date`, `time`, `pageTitle`, `robots`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(5, 1, 1569916757, 'Was kann man gegen das Bienensterben tun?', 0, 'was-kann-man-gegen-das-bienensterben-tun', 1, 1568030460, 1568030460, '', '', NULL, 'Tipps', '<p>Bienen müssen geschützt werden, da es ohne diese fleißigen Helfer viele Dinge gar nicht mehr geben würden.</p>', 1, 0, 0xe321c1e8e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `featured`, `alias`, `author`, `date`, `time`, `pageTitle`, `robots`, `description`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `published`, `start`, `stop`, `linkText`, `cssStyleSelector`) VALUES(6, 1, 1569916733, 'Bienenhonig', 0, 'bienenhonig', 1, 1568030520, 1568030520, '', '', NULL, 'Ernährung', '<p>Der Honig, der aus dem Nektar von Blüten und aus Honigtau besteht, ist die Nahrungsreserve der Bienen und wird nur dann erzeugt, wenn die Ernährung des Volkes und die Aufzucht der Brut gedeckt ist.</p>', 1, 0, 0xe0e63790e41e11e98cc3e0d55edd9ad9, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', '', 0, '', 'above', 0, NULL, 'default', 0, 0, '', 0, '', 0, 1, '', '', '', NULL);
